import React from 'react';
import './App.css';
import Login from './paginas/Login';
import Dashboard from './paginas/Dashboard';
import Home from './paginas/Home';
import Header from "./componentes/Header";
import { BrowserRouter, Switch, Route, NavLink } from 'react-router-dom';
import PrivateRoute from "./componentes/PrivateRoute";
import PublicRoute from "./componentes/PublicRoute";
import { getToken} from "./utils/Commons";
import LinkMenu from './componentes/LinkMenu';


class App extends React.Component{
    render () {
        return (
            <div>

                <Header className="App-header" />

                <BrowserRouter>
                    <div>
                        <div className="header">
                            {/*<LinkMenu urlto="/accion_social/login" texttourl="Login" ></LinkMenu>*/}
                            <LinkMenu exact urlto="/accion_social" texttourl="Home" ></LinkMenu>
                            <LinkMenu  urlto="/accion_social" texttourl="Logout" ></LinkMenu>
                        </div>
                        <div className="content">
                            <Switch>
                                <PrivateRoute exact path="/accion_social" component={Home} />
                                <PublicRoute path="/accion_social/login" component={Login} />
                                <PublicRoute path="/accion_social/logout" component={Login} />
                            </Switch>
                        </div>
                    </div>
                </BrowserRouter>

            </div>
        );
    }
}

export default App;
